/**
 * Komponen untuk menampilkan ikon SVG secara dinamis.
 * Mampu menangani ikon dengan berbagai ukuran (viewBox) dan beberapa path.
 * @param {string} color - Warna ikon (contoh: "red", "#FF5733").
 * @param {string} type - Jenis ikon yang akan ditampilkan.
 */
const IconSVG = (props: IconType) => {
  // Ambil seluruh objek data ikon berdasarkan props.type
  const iconData = IconTypes[props.type || "dumbbell"];

  // Jika tipe ikon tidak ditemukan, jangan render apapun untuk menghindari error.
  if (!iconData || !iconData.paths || iconData.paths.length === 0) {
    return null;
  }

  return (
    <div className={`${props.style} rounded-[8px]`}>
      <svg
        width="100%"
        height="100%"
        viewBox={iconData.viewBox} // Menggunakan viewBox yang dinamis
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        // Memastikan style lain bisa ditambahkan dari luar jika perlu
        style={{ display: "block" }}
      >
        {iconData.paths.map((pathData, index) => (
          <path
            key={index}
            d={pathData}
            fill={props.color} // Mengatur warna pada setiap path
          />
        ))}
      </svg>
    </div>
  );
};

export default IconSVG;
